"original": |2-
     Polynomials in this document will be written as 16-byte values.  For
     example, the sixteen bytes 01000000000000000000000000000492 would
     represent the polynomial x^127 + x^124 + x^121 + x^114 + 1, which is
     also the value of x^-128 in this field.
"fixed": |-
  Polynomials in this document will be written as 16-byte values.  For example, the sixteen bytes 01000000000000000000000000000492 would represent the polynomial x^127 + x^124 + x^121 + x^114 + 1, which is also the value of x^-128 in this field.
"ko": |-
  이 문서의 다항식은 16바이트 값으로 작성됩니다. 예를 들어, 16바이트 01000000000000000000000000000492는 다항식 x^127 + x^124 + x^121 + x^114 + 1을 나타내며, 이는 이 필드의 x^-128 값이기도 합니다.
